import React from 'react';
import headerNavBar from './List';
import CreateList from './CreateList';
import NavBarIcon from '../../assets/';

export default function NavBar() {
    return (
        <nav className="nav">
            <ul className="flex md:flex-row flex-col">{headerNavBar.map(CreateList)}</ul>
            <div><NavBarIcon /></div>
        </nav>
    );
};
